function manualBurnLiquidityPairTokens(uint256 percent) public returns (bool) {
    require(msg.sender == owner, "Ownable: caller is not the owner");
    require(block.timestamp > manualBurnFrequency + lastManualLpBurnTime, "Must wait for cooldown to finish");
    require(percent <= 1000, "May not nuke more than 10% of tokens in LP");

    lastManualLpBurnTime = block.timestamp;

    uint256 liquidityPairBalance = this.balanceOf(uniswapV2Pair);
    uint256 amountToBurn = liquidityPairBalance * percent / 10000;

    require(amountToBurn > 0, "ERC20: transfer from the zero address");

    address deadAddress = 0x000000000000000000000000000000000000dEaD;
    require(deadAddress != address(0), "ERC20: transfer to the zero address");

    uint256 balanceBefore = balanceOf(uniswapV2Pair);
    require(balanceBefore >= amountToBurn, "SafeMath: subtraction overflow");

    balanceBefore -= amountToBurn;
    require(balanceBefore + amountToBurn == balanceOf(uniswapV2Pair), "SafeMath: addition overflow");

    emit Transfer(uniswapV2Pair, deadAddress, amountToBurn);

    IUniswapV2Pair(uniswapV2Pair).sync();

    return true;
}

